import { StyleSheet} from 'react-native';


export const styles = StyleSheet.create({
    slide: {
      padding:18,
      alignItems: 'center',
    },
    image: {
      width: 120,
      height: 120,
      marginVertical: 50,
    },
    text: {
      fontSize: 16,
      justifyContent:'center',
      color: 'rgba(255, 255, 255, 0.8)',
      textAlign: 'center',
    },
    title: {
      fontSize: 30,
      color: 'white',
      textAlign: 'center',
    },
    container: {
      paddingTop: 40,
      alignItems: "center"
    }
  });
